import React from 'react';
import { Link } from 'react-router-dom';
import './App.css'; // CSSファイルのインポート

export const Header = () => {
    return(
        <div className='header-wrapper'>
            <div className='header-wrapper-left'>
                <Link to='/' className='link-top'>Top</Link>
            </div>
            <div className='header-wrapper-right'></div>
            <Link to='/theme' className='links'>Theme</Link>
            <Link to='/theme/form'>Form</Link>
        </div>
    )
}
